#miho-1
 miho_d1_1:0 "我:\n(唉，今天的学习就到这里吧，该回去睡了...)"
 miho_d1_2:0 "Nishizumi Miho:\n啊，顾问先生晚上好！"
 miho_d1_3:0 "Nishizumi Miho:\n请问现在有时间吗？"
 miho_d1_4:0 "我:\n(我撇了一眼墙上的钟，貌似还能陪她一会...就一小会吧...)"
 miho_d1_5:0 "我:\n啊...当然"
 miho_d1_6:0 "Nishizumi Miho:\n这本书是我在之前Senshado联盟的图书馆借来的战术指南..."
 miho_d1_7:0 "Nishizumi Miho:\n有一些地方不是很明白，可以请Rekordny帮助我理解一下吗？"
 miho_d1_8:0 "我:\n(啊...又是讨厌的理论知识吗...)"
 miho_d1_9:0 "我:\n我....没什么太大自信呢。"
 miho_d1_10:0 "Nishizumi Miho:\n没，没关系的，顾问先生既然是学院毕业的一定看的懂的！"
 miho_d1_11:0 "我:\n嗯...我尽量试试看。"
 miho_d1_12:0 "Nishizumi Miho:\n太好了，谢谢Rekordny。嗯...就是关于这页的战况图...."
 miho_d1_13:0 "Nishizumi Miho:\n这一支轻型战车的编队，为什么执意要穿过这片沼泽来构筑阵地....."
 miho_d1_14:0 "\n(...)"
 miho_d1_15:0 "\n(......)"
 miho_d1_16:0 "\n(...不知不觉好像一小时过去了)"
 miho_d1_17:0 "Nishizumi Miho:\n原来如此！多亏顾问先生点明了我。"
 miho_d1_18:0 "Nishizumi Miho:\nRekordny果然相当的擅长Senshado呢！"
 miho_d1_19:0 "我:\n美穗真的在Senshado上很用功啊。"
 miho_d1_20:0 "Nishizumi Miho:\n那个...我认为，如果要避免给大家带来困扰的话，果然还是要加倍努力得带领团队吧。"
 miho_d1_21:0 "Nishizumi Miho:\n还有，果然询问顾问先生是对的呢！"
 miho_d1_22:0 "Nishizumi Miho:\n呵呵...与其说我用功的话，不如说是更喜欢发现Senshado更多得可能性。"
 miho_d1_23:0 "Nishizumi Miho:\n所以才重新拾起Senshado，也许有一天可以走出来一条和姐姐不一样的路吧。"
 miho_d1_24:0 "Nishizumi Miho:\n这也是我的人生到现在，过的最充实的一段时间！"
 miho_d1_25:0 "我:\n(没想到她还这么自律啊...)"
 miho_d1_26:0 "我:\n...你一定可以的。"
 miho_d1_27:0 "Nishizumi Miho:\n接下来还要去和大家一起去看昨天的训练录像...战术推演...保养战车..."
 miho_d1_28:0 "我:\n好像听上去会很累啊..."
 miho_d1_29:0 "Nishizumi Miho:\n嗯~就算Rekordny这么说...不觉得一直发呆会更累吗？"
 miho_d1_30:0 "Nishizumi Miho:\n我从之前就很少交到要好的朋友..."
 miho_d1_31:0 "Nishizumi Miho:\n但是事情一旦和Senshado关联上，大家就都其乐融融的在一起了呢！"
 miho_d1_32:0 "我:\n我也能理解你的心情哦！"
 miho_d1_33:0 "Nishizumi Miho:\n真的吗？"
 miho_d1_34:0 "Nishizumi Miho:\nRekordny能够理解我真的是太好了，有时候不太有人能理解我的心情呢..."
 miho_d1_35:0 "Nishizumi Miho:\n姐姐也是...小时候总是和妈妈督促我贯彻西住流什么的..."
 miho_d1_36:0 "Nishizumi Miho:\n妈妈她居然还说道：“如果美穗不好好练习的话西住家就要没落了”这种话哦？"
 miho_d1_37:0 "Nishizumi Miho:\n而且啊...啊！糟糕！"
 miho_d1_38:0 "Nishizumi Miho:\n今天我还要早一点到录像间去准备资料，我竟然忘掉了...!"
 miho_d1_39:0 "Nishizumi Miho:\n那我先走了，顾问先生！真的非常感谢你~！"
 miho_d1_40:0 "我:\n..."
 miho_d1_41:0 "\n（还没等我回过神来，她已经自顾自的小跑走了）"
 miho_d1_42:0 "\n（砰...咣当）"
 miho_d1_43:0 "Nishizumi Miho:\n呀啊啊啊"
 miho_d1_44:0 "Nishizumi Miho:\n实在对不起对不起，我刚刚没有看到人...."
 miho_d1_45:0 "Nishizumi Miho:\n对不起对不起....."
 miho_d1_46:0 "我:\n......"
 
#Erika Chapter1

 erika_d1_1:0 "在我没被真穗正式向Senshado部介绍之前，我就和Erika认识了。"
 erika_d1_2:0 "女学生\n这里就是为您准备的住处了。"
 erika_d1_3:0 "我\n好的，多谢你了。"
 erika_d1_4:0 "女学生\n不客气。对了，我们会组织专人带领新上舰人员熟悉甲板区，集散点就在这附近。失陪了。"
 erika_d1_5:0 "十分钟之后"
 erika_d1_6:0 "我\n好的，这样行李就整理得差不多了吧。"
 erika_d1_7:0 "我抬头看了一眼墙上的挂钟。"
 erika_d1_8:0 "我\n时间还很宽裕，去外面转转吧。"
 erika_d1_9:0 "我\n......这下麻烦了"
 erika_d1_10:0 "我发现自己置身于陌生的街道中。我只是离开一小会，再回到队伍处时，他们已经上车到下一个地点去了。"
 erika_d1_11:0 "我\n还有半小时就到集合时间了.......还是问个路好了。"
 erika_d1_12:0 "我环顾四周，发现不远处的住宅里走出了一位身着黑森峰制服的银发少女。"
 erika_d1_13:0 "如同看到了救命稻草一般，我向她走去。"
 erika_d1_14:0 "我\n不好意思，请问你可以带我去Senshado部吗？"
 erika_d1_15:0 "眼前的少女上下打量着我身上的装甲兵制服。"
 erika_d1_16:0 "Erika\n啊，你一定就是西住队长说的那个顾问吧。怎么会出现在这里？"
 erika_d1_17:0 "我\n呃......本来是跟着导游想在学园舰上转转的，一不注意和队伍走散了。还请这位美丽的小姐......"
 erika_d1_18:0 "Erika\n我就是黑森峰Senshado的副队长Erika，随我来吧。"
 erika_d1_19:0 "我\n！"
 erika_d1_20:0 "我\nErika...Erika？就是那个传闻中说话难听性格糟糕的副队长？"
 erika_d1_21:0 "Erika\n在想什么呢？快点跟过来啊。"
 erika_d1_22:0 "我\n好、好的。"
 erika_d1_23:0 "我\n第一天就留下不好的印象了诶......得做点什么抢救一下啊。"
 erika_d1_24:0 "我和她并排走在大街上。"
 erika_d1_25:0 "我\n原来是Erika副队长，真是失礼了。"
 erika_d1_26:0 "Erika\n客套话就不必对我说了。"
 erika_d1_27:0 "我\n……"
 erika_d1_28:0 "我\n果然这传闻属实吧！"
 erika_d1_29:0 "Erika\n顾问先生是军人出身，怎么会犯这种低级错误？没有遇到我的话，不是会给西住队长添麻烦吗？"
 erika_d1_30:0 "我\n实在是不好意思......不过是遇见了黑森峰Senshado部的车队路过，这实在是意外之喜，不由得停下了脚步欣赏她们的英姿。"
 erika_d1_31:0 "我\n到底是能够统治德意志的学园，仅是普通的行进队列，就能做到如此惊人的整齐划一，这在我们正规战车部队都是很难做到的。"
 erika_d1_32:0 "Erika\n到底是装甲学院出身，还是有点眼力的嘛。"
 erika_d1_33:0 "我\n总算是语气轻松了点啊……"
 erika_d1_34:0 "Erika\n不过呢，主要是西住队长的功劳，我们只不过是做了点小小的贡献罢了。"
 erika_d1_35:0 "我\n可不是小小的贡献。我在装甲兵学院的时候就听说，黑森峰Senshado部的训练可不比我们轻松啊。"
 erika_d1_36:0 "Erika\n说的也是呢。但是所有人都是带着对战车的热爱才选择乘上战车，成为黑森峰的一份子的。"
 erika_d1_37:0 "我\n其实不完全是啦。对Nishizumi Maho队长的钦佩也是我努力登上齐柏林号的一个原因。"
 erika_d1_38:0 "我\n能够为一位有着如此魄力的领导者效力，是我的人生目标。"
 erika_d1_39:0 "我并没有察觉到身旁的她表情的细微变化。"
 erika_d1_40:0 "Erika\n我说啊，想要为西住队长效力，你还得成为更加可靠的人才行呢。"
 erika_d1_41:0 "我\n……这是又怎么了"
 erika_d1_42:0 "Erika\n还有，如果你让黑森峰或者真穗队长沾上污名的话，我可不会原谅你。"
 erika_d1_43:0 "我为她事出突然的态度转变感到吃惊，但是很快便明白过来原因。"
 erika_d1_44:0 "我\n看来就不该提到真穗的啊，这下真是失策了"
 erika_d1_45:0 "我\nErika副队长说的是，还请你多多指教了。我会尽快成为像你一样可靠的顾问的。"
 erika_d1_46:0 "Erika\n嗯，共同进步吧。"
 erika_d1_47:0 "她可能也意识到了之前自己的态度变化，主动伸出手。我则是如获至宝一般握住她的手。"
 erika_d1_48:0 "我\nErika副队长也不完全是谣言说的那样嘛。"
 erika_d1_49:0 "Erika\n嗯？什么谣言？顾问先生说来听听？"
 erika_d1_50:0 "我\n没、没什么，哈哈……"
 erika_d1_51:0 "我\n还是第一次看到她笑，不过这个笑容实在是让人不寒而栗啊。"

#Erika Chapter2

 erika_d2_1:0 "事情发生在我成为Erika的工作搭档之后的第一个周末，不过得先从周五傍晚开始说起了。"
 erika_d2_2:0 "我在回到住处之后，发现有物品忘在了作战会议室内，只能往回赶了。"
 erika_d2_3:0 "我\n果然在这里啊。嗯？这是......"
 erika_d2_4:0 "会议室的桌上，还放着一个布袋。"
 erika_d2_5:0 "我\n这又是谁的东西落下了"
 erika_d2_6:0 "我走近一瞧，发现布袋上印着个卡通鳄鱼图案。"
 erika_d2_7:0 "我\n鳄鱼么...是Erika的包吧。她可不像是会忘记东西的人啊"
 erika_d2_8:0 "在我的印象里，Erika总是最后一个离开会议室的人。"
 erika_d2_9:0 "我\n难道她没走吗？"
 erika_d2_10:0 "我来到窗边，发现外面的停放着重型坦克的库房里还有灯光亮着。"
 erika_d2_11:0 "我\n她在哪里干什么呢......我最好还是去看看吧。"
 erika_d2_12:0 "我\nErika副队长，你在这里吗？"
 erika_d2_13:0 "Erika\n谁啊？"
 erika_d2_14:0 "我向声音方向看去，Erika蹲在她的虎王旁边，手上拿着工具。"
 erika_d2_15:0 "Erika\n哦，是你啊。顾问先生这么晚来库房有何贵干呢？"
 erika_d2_16:0 "我\n去会议室拿东西，看到你的包还在那里，库房灯也没关，就想着来看看。"
 erika_d2_17:0 "我走到她身边，弯腰检视着负重轮与履带。"
 erika_d2_18:0 "我\n虎王这是怎么了？"
 erika_d2_19:0 "Erika\n训练快结束的时候发现提速有点问题，履带声音也不对劲，就想着留下来修好了。"
 erika_d2_20:0 "我\n你一个人吗？怎么不叫维修班的同学来......"
 erika_d2_21:0 "Erika\n打扰别人的周末很不好哦。再说了都是些小毛病，我一个人也行的。"
 erika_d2_22:0 "我\n......有哪里需要我帮忙吗？"
 erika_d2_23:0 "Erika\n嗯......履带我已经检修完了，可能得换燃料泵或者火花塞什么的，麻烦你去维修间拿两个来好吗？"
 erika_d2_24:0 "......"
 erika_d2_25:0 "夜幕降临。"
 erika_d2_26:0 "Erika\n好，这下就全部换好了。"
 erika_d2_27:0 "我\n亨舍尔这个混蛋......"
 erika_d2_28:0 "我\n要不要试车？"
 erika_d2_29:0 "Erika\n当然了，麻烦你当司机了。"
 erika_d2_30:0 "她从车里拿出耳机和喉部麦克风递给我，我不禁嘴角上扬。Erika_7"
 erika_d2_31:0 "我\n这种感觉真是久违，有段时间没乘上战车了。"
 erika_d2_32:0 "Erika\n是么，那顾问先生先登车就位吧。"
 erika_d2_33:0 "我进入驾驶室，手握着这辆虎式B型坦克的方向盘。这时我突然意识到了什么。"
 erika_d2_34:0 "我\n刚才，Erika是对我笑啦？"
 erika_d2_35:0 "Erika\n顾问先生，准备好了吗？"
 erika_d2_36:0 "我\n啊嗯，可以开始了。我先发动车辆吧。"
 erika_d2_37:0 "690匹马力的12缸迈巴赫HL230汽油机发出了怒吼。"
 erika_d2_38:0 "Erika\n哦哦，声音很对呢。开到外面去跑一圈吧！"
 erika_d2_39:0 "Erika\nPanzer Vor！"
 erika_d2_40:0 "我把这个大家伙开出库房，绕着整个库区跑了一圈，又回到重型坦克的库房前。Erika_0"
 erika_d2_41:0 "一路上，熟悉的驾驶员观察视角，切身感受到的引擎的澎湃动力，无不让我回想起成为新兵的那段好时光，差点就要在和Erika的通话频道里笑出声来。"
 erika_d2_42:0 "在Erika的指挥下，我把虎王停在了原处。"
 erika_d2_43:0 "我\n真是过瘾啊，开上战车之后，修车的疲惫就一扫而光了呢！"
 erika_d2_44:0 "Erika\n是吗，那真是太好了。收拾一下工具就离开吧。"
 erika_d2_45:0 "Erika\n我欠你个人情呢，顾问先生。"
 erika_d2_46:0 "我\n举手之劳嘛，能帮到Erika副队长也是我的荣幸。"
 erika_d2_47:0 "Erika\n顾问先生可以直接叫我Erika哦。没关系的。"
 erika_d2_48:0 "我\n......！"
 erika_d2_49:0 "我\n啊，是么......"
 erika_d2_50:0 "我\n那你也可以直接称呼我的名字嘛，顾问先生听起来太正经了不太适应哈哈哈......"
 erika_d2_51:0 "Erika\n我记住了。这个人情会好好还上的，期待一下吧！"
